import React from "react";
import TextPicture from "../textpicture/textpicture";


export default function MenuItems({items}){
    return(
    items.map(item =>{
        return (
            <>
                <TextPicture key={item.id.toString()} text={item.name} pic='arrow.png' containerClass='menu-item-1' textClass='menu-item-heading' picClass='menu-item-img' id={item.name}/>
            </>
        )})
    )
}
